window.bookSummaryJSON = "<p><b>Nether Ops works in shadows, and those shadows taint all they touch.</b>&nbsp;</p> <p>Soren Voss believes in the Republic. But when he puts a promising Navy career on hold to serve as a covert agent, he encounters truths that throw everything he knows into turmoil. After weeks in deep cover living life with ruthless gangs, Soren uncovers a stolen cache of weapons, a mysterious upgraded form of legionnaire armor, and a written oath of loyalty for someone named...Goth Sullus. The agent follows leads that bring him face-to-face with crooked legionnaires, slimy politicians, and a powerful smuggler and gunrunner named Scarpia.&nbsp;</p> <p>Soren follows a darkening path to the heart of the Republic, and what he uncovers leaves him wondering not only if the Republic can be saved, but if he's even on the right side.&nbsp;</p> <p>US Army veteran Richard Fox, author of the Ember War Saga, teams up with Anspach &amp; Cole to deliver this thrilling stand-alone set in the aftermath of <i>Galaxy's Edge: Kill Team</i>!&nbsp;&nbsp;</p>"; 
